defs.script:
var a7_idx;
var a7_on;
var a7_fr;
var a7_btnPauseLeft,a7_btnPlayLeft,a7_btnPauseRight,a7_btnPlayRight;
var a7_playsRight,a7_isPaused;
var a7_int;
var a7_pause,a7_playRight,a7_playLeft,a7_playBwd,a7_playFwd;
var a7_fps,a7_spd;
var a7_setFps;
var a7_seekFrame,a7_gotoNext,a7_gotoPrev;
var a7_stopFirst,a7_stopLast;
var a7_playPauseBwd,a7_playPauseFwd;
var a7_stepBwd,a7_stepFwd;
var a7_spdIncr,a7_spdDecr,a7_spdReset;
(function(){
function onload(){
if(!a7_fr){
a7_fr=new Array();
a7_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==7){
a7_fr[ocgName[1]]=ocg[i];
}
}
a7_btnPauseLeft=document.getElementById('7.PauseLeft');
a7_btnPlayLeft=document.getElementById('7.PlayLeft');
a7_btnPauseRight=document.getElementById('7.PauseRight');
a7_btnPlayRight=document.getElementById('7.PlayRight');
a7_playsRight=true;
a7_isPaused=false;
a7_playing=false;
a7_fps=10;
a7_spd=1;
a7_setFps=function(f){
a7_fps=(f==0?1e-6:f);
if(a7_playing){
if(a7_playsRight){a7_playRight();}else{a7_playLeft();}
}
};
a7_seekFrame=function(f){
if(f>29||f<0){return -1;}
a7_idx=f;
a7_fr[a7_on].setAttribute('visibility','hidden');
a7_fr[f].setAttribute('visibility','visible');
a7_on=f;
return 0;
};
a7_stopFirst=function(){a7_pause(true);a7_seekFrame(0);};
a7_stopLast=function(){a7_pause(true);a7_seekFrame(29);};
a7_gotoNext=function(){
if(a7_seekFrame(a7_idx+1)<0){
if(a7_playing){a7_seekFrame(0);a7_setFps(10);}else{a7_stopLast();}
return;
}
};
a7_gotoPrev=function(){
if(a7_seekFrame(a7_idx-1)<0){
if(a7_playing){a7_seekFrame(29);}else{a7_stopFirst();}
return;
}
};
a7_pause=function(stop){
try{clearInterval(a7_int);}catch(e){}
a7_playing=false;
a7_isPaused=!stop;
a7_btnPauseLeft.setAttribute('visibility','hidden');
a7_btnPlayLeft.setAttribute('visibility','visible');
a7_btnPauseRight.setAttribute('visibility','hidden');
a7_btnPlayRight.setAttribute('visibility','visible');
};
a7_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a7_gotoNext()',1000/a7_fps/a7_spd);}catch(e){}
try{clearInterval(a7_int);}catch(e){}
a7_int=tmp_int;
a7_playsRight=true;
a7_playing=true;
a7_isPaused=false;
a7_btnPauseLeft.setAttribute('visibility','visible');
a7_btnPlayLeft.setAttribute('visibility','hidden');
a7_btnPauseRight.setAttribute('visibility','visible');
a7_btnPlayRight.setAttribute('visibility','hidden');
};
a7_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a7_gotoPrev()',1000/a7_fps/a7_spd);}catch(e){}
try{clearInterval(a7_int);}catch(e){}
a7_int=tmp_int;
a7_playsRight=false;
a7_playing=true;
a7_isPaused=false;
a7_btnPauseLeft.setAttribute('visibility','visible');
a7_btnPlayLeft.setAttribute('visibility','hidden');
a7_btnPauseRight.setAttribute('visibility','visible');
a7_btnPlayRight.setAttribute('visibility','hidden');
};
a7_playPauseBwd=function(){if(a7_playing){a7_pause();}else{a7_playBwd();}};
a7_playPauseFwd=function(){if(a7_playing){a7_pause();}else{a7_playFwd();}};
a7_spdIncr=function(){a7_spd*=1.1;a7_setFps(a7_fps);};
a7_spdDecr=function(){a7_spd/=1.1;a7_setFps(a7_fps);};
a7_spdReset=function(){a7_spd=1;a7_setFps(a7_fps);};
a7_stepBwd=function(){if(!a7_playing){a7_seekFrame(a7_idx-1);a7_isPaused=true;}};
a7_stepFwd=function(){if(!a7_playing){a7_seekFrame(a7_idx+1);a7_isPaused=true;}};
a7_playBwd=function(){if(a7_idx==0||!a7_isPaused){a7_stopLast();}a7_playLeft();};
a7_playFwd=function(){if(a7_idx==29||!a7_isPaused){a7_stopFirst();}a7_playRight();};
a7_seekFrame(0);
}document.getElementById('anm7').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm7').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm7').addEventListener('touchend',onTouchEndWdgt);
document.getElementById('anm7').addEventListener('touchstart',onTouchStartWdgt);
document.getElementById('anm7').addEventListener('touchmove',onTouchMove);
onvisible();
}
function onvisible(){
if(a7_playsRight){a7_playRight();}else{a7_playLeft();}
}
function onhidden(){
if(a7_playing){a7_pause(true);}
if(!a7_isPaused)a7_playsRight=true;
if(!a7_isPaused&&a7_idx!=0)a7_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
var permPause7=false; function onWidgetUpAction(event){
try{
if(!a7_isPaused)a7_stopFirst();
if(event.shiftKey)a7_playsRight=!a7_playsRight;
if(a7_idx==29&&a7_playsRight)a7_stopFirst();
if(a7_idx==0&&!a7_playsRight)a7_stopLast();
if(a7_playsRight){a7_playRight();}else{a7_playLeft();}
}catch(e){}
}
function onTouchStartWdgt(event){
event.preventDefault();
event.stopPropagation();
permPause7=false; try{if(a7_playing){a7_pause();}}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();
event.stopPropagation();
if(event.targetTouches.length>0){permPause7=true;}
else{
if(permPause7){permPause7=false;}
else{onWidgetUpAction(event);}
}
}
function onTouchMove(event){
event.preventDefault();
event.stopPropagation();
}
function onMouseDownWdgt(event){
event.preventDefault();
event.stopPropagation();
try{if(a7_playing){a7_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();
event.stopPropagation();
onWidgetUpAction(event);
}
})();
